import{_ as p}from"./plugin-vue_export-helper-c27b6911.js";import{o as _,c as e,e as t}from"./app-f05d3ed8.js";const o={},c=t("<p>《三命通会》卷 九·六癸日丁巳时断</p><p>六癸日生时丁巳，贵地逢财遇暗官；有托就看财禄盛，无依必定福偏残。</p><p>癸日丁巳时，癸合财官，癸用丙为财，戊为官，庚为印，巳为天乙贵人。</p><p>巳上庚金长生，丙戊建禄，癸水受胎，若有倚托，通水气月，贵，不通水气。</p><p>平常。</p><p>时逢三奇，大抵发于晚年。</p><p>癸丑日丁巳时，先贫后富，行火水运，发达。</p><p>癸卯日丁巳时，若子月，身旺财旺，贵显。</p><p>癸巳日丁巳时，财官双美。</p><p>子月，贵。</p><p>火月，富。</p><p>天干透土，地支午未，主大权贵。</p><p>纯丑，极品。</p><p>癸未日丁巳时，寅午戌月，身财旺显，秋冬禄旺，伤残疾。</p><p>癸酉日丁巳时，先贫后富。</p><p>巳酉月，官印俱旺。</p><p>亥卯未，食伤生财，贵显。</p><p>午戌，财旺，亦吉。</p><p>癸亥日丁巳时，刑害。</p><p>春夏月生，好。</p><p>秋，印绶，吉。</p><p>冬，平常。</p><p>庚寅年月，武贵。</p><p>巳时禄马同争先，造化无私产大贤；刑冲减半无空克，运至声名扬九天。</p><p>癸日时临丁巳，贵人禄马同乡，三重蛇马正朝纲，玉殿金阶来往。</p><p>壬亥申寅减半，只愁运落空亡，果无冲克无刑伤，舞拜凤凰池上。</p>",26),r=[c];function s(n,a){return _(),e("div",null,r)}const f=p(o,[["render",s],["__file","280卷 九·六癸日丁巳时断.html.vue"]]);export{f as default};
